import React from "react";

function Navbar(props) {
  let navbarComponents = props.children;
  
  let navbarClass = navbarComponents.toLowerCase();
  console.log(navbarClass);
  return (
    <div className={props.children.toLowerCase}>
      {props.children}
    </div>
  )
}

export default Navbar;
